	add("desman", "{\"term\":\"desman\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"German\", \"English\", \"French\", \"Swedish\"], \"text\":\"From French \u0027desman\u0027 German \u0027desman\u0027 from Swedish \u0027desmanr√•tta\u0027 (muskrat) from \u0027desman\u0027 (musk)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Either of two species, or , of aquatic or semi-aquatic insectivore of the mole family, Talpidae, found in Europe\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1995\u0027\u0027, R. David Stone (editor), \u0027Eurasian Insectivores and Tree Shrews: Status Survey and Conservation Action Plan\u0027, [http://books.google.com.au/books?id\u003ddIRAR6uimdQC\u0026amp;pg\u003dPA50\u0026amp;dq\u003d%22desman%22%7C%22desmans%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dpgtVUpjUDYPPkwXoioH4Dw\u0026amp;redir_esc\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22desman%22%7C%22desmans%22\u0026amp;f\u003dfalse page 50\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Unlike the Russian \u0027\u0027desman\u0027\u0027, the Pyrenean species lives along fast-flowing mountain streams\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, George A. Feldhamer, Lee C. Drickamer, Stephen H. Vessey, Joseph F. Merritt, Carey Krajewski, \u0027Mammalogy: Adaptation, Diversity, Ecology\u0027, 3rd Edition, [http://books.google.com.au/books?id\u003dudCnKce9hfoC\u0026amp;pg\u003dPA250\u0026amp;dq\u003d%22desman%22%7C%22desmans%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dpgtVUpjUDYPPkwXoioH4Dw\u0026amp;redir_esc\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22desman%22%7C%22desmans%22\u0026amp;f\u003dfalse page 250\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Restricted to the Old World, \u0027\u0027desmans\u0027\u0027 have a diet consisting of aquatic invertebrates and fish\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, Joseph F. Merritt, \u0027The Biology of Small Mammals\u0027, [http://books.google.com.au/books?id\u003dLF_x_kmDjr4C\u0026amp;pg\u003dPA38\u0026amp;dq\u003d%22desman%22%7C%22desmans%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dpgtVUpjUDYPPkwXoioH4Dw\u0026amp;redir_esc\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22desman%22%7C%22desmans%22\u0026amp;f\u003dfalse page 38\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"With the aid of its Eimer\u0027s organs, the \u0027\u0027desman\u0027\u0027 was able to detect engraved lines only one-fifteenth of a millimeter (0.067 mm, or 0.002 inches) in depth and width. There are two extant species of desmans: the Pyrenean \u0027\u0027desman\u0027\u0027 (\u0027Galemys pyrenaicus\u0027), weighing about 65 g (2.3 oz) (fig 2.10), and the larger Russian \u0027\u0027desman\u0027\u0027 (\u0027Desmana moschata\u0027), weighing 500 g (17.6 oz\", \"priority\":10}]}, \"synonyms\":{}}");

